INSERT INTO `tb_subject` VALUES (1266324796660248578, '数学', '数学，一门有趣的学科，走起！！！！', 'iconfont icon-xuexiao_kemu', '/home/subject/shuxue', '2020-05-29 19:05:33', 28, 0);
INSERT INTO `tb_subject` VALUES (1266325297657278465, '语文', '语文，培养文学素养，陶冶情操', 'iconfont icon-xuexiao_kemu', '/home/subject/yuwen', '2020-05-29 19:07:33', 6, 0);
INSERT INTO `tb_subject` VALUES (1266333627301752833, '历史', '历史，指人类社会过去的事件和行动，以及对这些事件行为有系统的记录、诠释和研究。历史可提供今人理解过去，作为未来行事的参考依据，与伦理、哲学和艺术同属人类精神文明的重要成果。', 'iconfont icon-xuexiao_kemu', '/home/subject/lishi', '2020-05-29 19:40:39', 0, 0);
INSERT INTO `tb_subject` VALUES (1266334063878467585, '化学', '化学是自然科学的一种，主要在分子、原子层面，研究物质的组成、性质、结构与变化规律，创造新物质。', 'iconfont icon-xuexiao_kemu', '/home/subject/huaxue', '2020-05-29 19:42:23', 0, 0);
INSERT INTO `tb_subject` VALUES (1266334688821374977, '算法', '算法（Algorithm）是指解题方案的准确而完整的描述，是一系列解决问题的清晰指令，算法代表着用系统的方法描述解决问题的策略机制。', 'iconfont icon-xuexiao_kemu', '/home/subject/suanfa', '2020-05-29 19:44:52', 0, 0);
INSERT INTO `tb_subject` VALUES (1266363686624321537, '英语', '英语，English! Fighting!', 'iconfont icon-xuexiao_kemu', '/home/subject/yingyu', '2020-05-29 21:40:05', 0, 0);
INSERT INTO `tb_subject` VALUES (1266365648090587137, '物理', '物理学是研究物质运动最一般规律和物质基本结构的学科。', 'iconfont icon-xuexiao_kemu', '/home/subject/wuli', '2020-05-29 21:47:53', 0, 0);
INSERT INTO `tb_subject` VALUES (1266365857319247873, '心理学', '心理学（英语：psychology）是一门研究人類以及的內在心理歷程、精神功能和外在行为的科学，', 'iconfont icon-xuexiao_kemu', '/home/subject/xinlixue', '2020-05-29 21:48:43', 0, 0);
INSERT INTO `tb_subject` VALUES (1266374031627673602, '地理', '地理（Geography），是世界或某一地区的自然环境（山川、气候等）及社会要素的统称。', 'iconfont icon-xuexiao_kemu', '/home/subject/dili', '2020-05-29 22:21:12', 2, 0);
INSERT INTO `tb_subject` VALUES (1266661195234037761, '其它', '计算机组成原理', 'iconfont icon-xuexiao_kemu', '/home/subject/qita', '2020-05-30 17:22:17', 2, 0);
INSERT INTO `tb_subject` VALUES (1283688075967492098, '地质', '勘查技术与工程是一个好专业,牛逼呀!', 'iconfont icon-xuexiao_kemu', '/home/subject/dizhi', '2020-07-16 17:01:02', 2, 0);
INSERT INTO `tb_subject` VALUES (1284535166583373825, '音乐', '人人都爱音乐！', 'iconfont icon-xuexiao_kemu', '/home/subject/yinle', '2020-07-19 01:07:04', 0, 0);
